                      <XAxis
                        dataKey="date"
                        tick={false}
                        label={{
                          value: "Date",
                          position: "insideBottom",
                          dy: 10,
                        }}
                        height={45}
                      />
                      <YAxis
                        domain={[0, 200]} // Set the Y-axis domain dynamically
                        label={{
                          value: `${param.parameterName} Data`,
                          angle: -90,
                          position: "center",
                          paddingRight: "20px",
                          dy: -10,
                        }}
                        width={80}
                      />
                      <CartesianGrid horizontal={false} vertical={false} />

                      <Line
                        layout="horizontal"
                        dataKey="value"
                        stroke={crossingThreshold ? "red" : "green"}
                      />

                      <ReferenceLine
                        y={minThreshold}
                        stroke="gray"
                        strokeDasharray="6 6"
                      />
                      <ReferenceLine
                        y={maxThreshold}
                        stroke="gray"
                        strokeDasharray="6 6"
                      />

                      <Tooltip />
                    </LineChart>
                  </div>
                </div>
              );
            })}
          </div>
        )}
      </div>
      {SnackBarMessage.showSnackBar && (
        <CustomizedSnackbars
          message={SnackBarMessage}
          onHandleClose={onHandleSnackClose}
        />
      )}
    </MuiPickersUtilsProvider>
  );
